import React from 'react';

function Home(prop) {

    return (
        <div className="container">
            <div className="container">
                <div className="col-12 col-md m-1">
                    <RenderCard item={prop.dish} />
                </div>
            </div>
            <h4>Home</h4>
        </div>
    );
}

export default Home;
